import React, { useEffect, useState } from "react";
import {
  getExpenses,
  addExpense,
  updateExpense,
  deleteExpense,
  exportCSV,
  exportPDF,
} from "./api";
import ExpenseForm from "./components/ExpenseForm";
import ExpenseChart from "./components/ExpenseChart";
import ExpenseList from "./components/ExpenseList"; // <-- Import the table view
import "./App.css";

function App() {
  const [expenses, setExpenses] = useState([]);
  const [editingExpense, setEditingExpense] = useState(null);
  const [viewMode, setViewMode] = useState("card"); // 'card' or 'list'

  useEffect(() => {
    fetchExpenses();
  }, []);

  const fetchExpenses = async () => {
    try {
      const res = await getExpenses();
      setExpenses(res.data);
    } catch (error) {
      console.error("Failed to fetch expenses:", error);
    }
  };

  const handleAddOrUpdate = async (expense) => {
    if (editingExpense) {
      await updateExpense(editingExpense.id, expense);
    } else {
      await addExpense(expense);
    }
    fetchExpenses();
    setEditingExpense(null); // Clear editing state
  };

  const handleEdit = (expense) => {
    setEditingExpense(expense);
  };

  const handleDelete = async (id) => {
    await deleteExpense(id);
    fetchExpenses();
  };

  const handleExportCSV = async () => {
    // ... (Your export logic remains the same)
  };

  const handleExportPDF = async () => {
    // ... (Your export logic remains the same)
  };

  return (
    <div className="app-container">
      <header className="app-header">
        <h1>💰 Expense Manager</h1>
        <div className="header-actions">
          <button onClick={() => setEditingExpense({ title: "", amount: "", category: "", date: "" })}>
            Add New Expense
          </button>
          <button onClick={handleExportCSV}>Export CSV</button>
          <button onClick={handleExportPDF}>Export PDF</button>
        </div>
      </header>

      <div className="dashboard-layout">
        <main className="main-content">
          <div className="view-controls">
            <h2>Your Expenses</h2>
            <div className="view-toggle">
              <button onClick={() => setViewMode("card")} className={viewMode === 'card' ? 'active' : ''}>Card View</button>
              <button onClick={() => setViewMode("list")} className={viewMode === 'list' ? 'active' : ''}>List View</button>
            </div>
          </div>

          {viewMode === 'card' ? (
            <div className="expenses-grid">
              {expenses.map((exp) => (
                <div className="expense-card" key={exp.id}>
                  <div className="card-header">
                    <h3>{exp.title}</h3>
                    <span className="card-amount">${parseFloat(exp.amount).toFixed(2)}</span>
                  </div>
                  <p className="card-category">📂 {exp.category}</p>
                  <p className="card-date">📅 {new Date(exp.date).toLocaleDateString()}</p>
                  <div className="card-actions">
                    <button className="edit-btn" onClick={() => handleEdit(exp)}>Edit</button>
                    <button className="delete-btn" onClick={() => handleDelete(exp.id)}>Delete</button>
                  </div>
                </div>
              ))}
            </div>
          ) : (
            <ExpenseList expenses={expenses} onEdit={handleEdit} onDelete={handleDelete} />
          )}
        </main>

        <aside className="sidebar">
          <div className="sidebar-widget">
            <h2>{editingExpense ? "Edit Expense" : "Add Expense"}</h2>
            <ExpenseForm
              onSubmit={handleAddOrUpdate}
              editingExpense={editingExpense}
              setEditingExpense={setEditingExpense}
            />
          </div>
          <div className="sidebar-widget">
            <h2>Spending Chart</h2>
            <ExpenseChart expenses={expenses} />
          </div>
        </aside>
      </div>
    </div>
  );
}

export default App;
